10:54 AM Defendant Jacob Jeffry Stilwell in court, in custody, with attorney Jessica A Klein.   Alyssa M. Schaller appeared for the State of Wisconsin.

The Court conducts a plea colloquy with the Defendant.
The Defendant pleads no contest to Count 1.
The Court finds the the Defendant guilty of Count 1.
Counts 2 & 3 are dismissed an read into Count 1 & case 22CF101. 

The State gives its sentencing recommendation.
The Defense gives its sentencing recommendation.
The Defendant presents statements.


The Defendant was sentenced to the following:


IMPOSED SENTENCE:   


3 YEARS IMPRISONMENT (CREDIT - 191 days)
  -  1 YEAR 6 MONTHS OF INITIAL CONFINEMENT
  -  1 YEAR 6 MONTHS OF EXTENDED SUPERVISION;

PROGRAMMING:
Defendant not eligible for the Challenge Incarceration Program.
Defendant is eligible for the Substance Abuse Program. 

CONDITIONS OF EXTENDED SUPERVISION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol or illegal drugs, CBD products, vaping products, or drug paraphernalia;
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed;
*Follow through with any assessments, evaluations, treatment and/or counseling recommended by Agent; 
*No presence on any premises whose primary business is serving or selling alcohol (i.e bars, taverns, or liquor stores);
*Installation of the Ignition Interlock Device;
*Defendant to complete "Thinking for Change" class. 
*Attendance at a Victim Impact Panel in Waukesha County within 6 months of release from custody;
*Do not drive or operate a motor vehicle without a valid license; Comply with all drivers licensing restrictions; 
*DNA sample to be provided;


COURT COSTS: WAIVED 
DNA SAMPLE AND SURCHARGE:  $250.00
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

*Felony warnings, voting rights and firearms warnings given.
